import React from "react";
import './tailwind.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Myprovider from "./context/Myprovider"; // Context provider
import { Signup } from "./components/Signup-Login"; // Signup component

function App() {
  return (
      <Myprovider>  {/* Your provider can be inside the Router */}
        <Routes>
          <Route path="/home" element={<Signup />} />
        </Routes>
      </Myprovider>

  );
}

export default App;
